// SPDX-License-Identifier: BSD-3-Clause
/// @title ERC-20 implementation for Dexhune
// Sources: 
// https://eips.ethereum.org/EIPS/eip-20
// https://docs.google.com/document/d/1YLPtQxZu1UAvO9cZ1O2RPXBbT0mooh4DYKjA_jp-RLM
// https://github.com/OpenZeppelin/openzeppelin-contracts/blob/master/contracts/token/ERC20/IERC20.sol
/*
*    ........................................................
*    .%%%%%...%%%%%%..%%..%%..%%..%%..%%..%%..%%..%%..%%%%%%.
*    .%%..%%..%%.......%%%%...%%..%%..%%..%%..%%%.%%..%%.....
*    .%%..%%..%%%%......%%....%%%%%%..%%..%%..%%.%%%..%%%%...
*    .%%..%%..%%.......%%%%...%%..%%..%%..%%..%%..%%..%%.....
*    .%%%%%...%%%%%%..%%..%%..%%..%%...%%%%...%%..%%..%%%%%%.
*    ........................................................
*/

pragma solidity >=0.4.22 <0.9.0;
import "./DexhuneTokenRoot.sol";

interface IERC20 {
    /**
     * @dev Emitted when `value` tokens are moved from one account (`from`) to
     * another (`to`).
     *
     * Note that `value` may be zero.
     */
    event Transfer(address indexed from, address indexed to, uint256 value);

    /**
     * @dev Emitted when the allowance of a `spender` for an `owner` is set by
     * a call to {approve}. `value` is the new allowance.
     */
    event Approval(address indexed owner, address indexed spender, uint256 value);

    /**
     * @dev Returns the value of tokens in existence.
     */
    function totalSupply() external view returns (uint256);

    /**
     * @dev Returns the value of tokens owned by `account`.
     */
    function balanceOf(address account) external view returns (uint256);

    /**
     * @dev Moves a `value` amount of tokens from the caller's account to `to`.
     *
     * Returns a boolean value indicating whether the operation succeeded.
     *
     * Emits a {Transfer} event.
     */
    function transfer(address to, uint256 value) external returns (bool);

    /**
     * @dev Returns the remaining number of tokens that `spender` will be
     * allowed to spend on behalf of `owner` through {transferFrom}. This is
     * zero by default.
     *
     * This value changes when {approve} or {transferFrom} are called.
     */
    function allowance(address owner, address spender) external view returns (uint256);

    /**
     * @dev Sets a `value` amount of tokens as the allowance of `spender` over the
     * caller's tokens.
     *
     * Returns a boolean value indicating whether the operation succeeded.
     *
     * IMPORTANT: Beware that changing an allowance with this method brings the risk
     * that someone may use both the old and the new allowance by unfortunate
     * transaction ordering. One possible solution to mitigate this race
     * condition is to first reduce the spender's allowance to 0 and set the
     * desired value afterwards:
     * https://github.com/ethereum/EIPs/issues/20#issuecomment-263524729
     *
     * Emits an {Approval} event.
     */
    function approve(address spender, uint256 value) external returns (bool);

    /**
     * @dev Moves a `value` amount of tokens from `from` to `to` using the
     * allowance mechanism. `value` is then deducted from the caller's
     * allowance.
     *
     * Returns a boolean value indicating whether the operation succeeded.
     *
     * Emits a {Transfer} event.
     */
    function transferFrom(address from, address to, uint256 value) external returns (bool);
}

error InsufficientBalance();
error NotEnoughAllowance(uint256 allowance, uint256 expectedAllowance);

contract DexhuneERC20 is IERC20, DexhuneTokenRoot {
    string constant NAME = "Dexhune";
    string constant SYMBOL = "DXH";
    uint8 constant DECIMALS = 0;

    
    mapping(address => mapping(address => uint256)) private allowances;
    mapping(address => uint) private cooler;

    function name() public pure returns (string memory) {
        return NAME;
    } 

    function symbol() public pure returns (string memory) {
        return SYMBOL;
    } 

    function decimals() public pure returns (uint8) {
        return DECIMALS;
    }

    function totalSupply() public view returns (uint256) {
        return _toUInt(_supply);
    }

    function balanceOf(address owner) public view returns (uint256 balance) {
        return _getFullBalance(owner);
    }

    function transfer(address _to, uint256 _value) external returns (bool) {
        _transferInternal(msg.sender, _to, _value);
        return true;
    }

    function transferFrom(address from, address to, uint256 value) external returns (bool) {
        uint256 currentAllowance = allowances[from][msg.sender];

        if (value > currentAllowance) {
            revert NotEnoughAllowance(value, currentAllowance);
        }
        
        _transferInternal(from, to, value);

        return true;
    }

    function _transferInternal(address from, address to, uint256 value) private {
        uint256 balance = _getFullBalance(from);
        balance -= value;

        if (balance < 0) {
            revert InsufficientBalance();
        }

        uint256 targetBalance = _getFullBalance(to);
        targetBalance += value;

        _setBalance(from, balance);
        _setBalance(to, targetBalance);

        emit Transfer(from, to, value);
    }

    function approve(address _spender, uint256 _amount) external returns (bool) {
        allowances[msg.sender][_spender] = _amount;
        emit Approval(msg.sender, _spender, _amount);
        
        return true;
    }

    function allowance(address _owner, address _spender) public view returns (uint256 remaining) {
        return allowances[_owner][_spender];
    }
}

contracts/DexhunePriceDAO.sol.content:
// SPDX-License-Identifier: BSD-3-Clause
/// @title Dexhune Price DAO Logic
/*
*    ........................................................
*    .%%%%%...%%%%%%..%%..%%..%%..%%..%%..%%..%%..%%..%%%%%%.
*    .%%..%%..%%.......%%%%...%%..%%..%%..%%..%%%.%%..%%.....
*    .%%..%%..%%%%......%%....%%%%%%..%%..%%..%%.%%%..%%%%...
*    .%%..%%..%%.......%%%%...%%..%%..%%..%%..%%..%%..%%.....
*    .%%%%%...%%%%%%..%%..%%..%%..%%...%%%%...%%..%%..%%%%%%.
*    ........................................................
*/

pragma solidity >=0.4.22 <0.9.0;

import "./DexhuneBase.sol";
import "./DexhuneRoot.sol";

error NotEligibleToVote();
error AlreadyVoted();
error ProposalDoesNotExist();
error VotingDeactivated();
error ProposalIsStillActive();
error ProposalHasExpired();

interface IERC721Proxy {
    /**
     * @dev Returns the number of tokens in ``owner``'s account.
     */
    function balanceOf(address owner) external view returns (uint256 balance);
}

contract DexhunePriceDAO is DexhuneBase, DexhuneRoot {    
    string price;
    uint256 votingDeadline;
    uint256 deadline;

    mapping(uint256 => mapping(address => int8)) votes;
    mapping(address => uint256) tickets;

    /// @dev Total proposal duration in seconds
    uint256 internal constant PROPOSAL_DURATION = 600; // 15 blocks per 30 seconds\

    /// @dev Total proposal voting duration in seconds
    uint256 internal constant PROPOSAL_VOTING_DURATION = 300;
    uint256 internal constant PROPOSAL_BLOCKS = BLOCKS_PER_SECOND * PROPOSAL_DURATION;
    uint256 internal constant PROPOSAL_VOTING_BLOCKS = BLOCKS_PER_SECOND * PROPOSAL_VOTING_DURATION;

    uint256 internal constant VERIFICATION_TICKET_DURATION = 3600; // 1 hour
    uint256 internal constant VERIFICATION_TICKET_BLOCKS = BLOCKS_PER_SECOND * VERIFICATION_TICKET_DURATION;

    function getPrice() public view returns(string memory) {
        return price;
    }

    function latestProposal() public view  returns (string memory description, string memory value, uint256 votesUp, uint256 votesDown) {
        PriceProposal memory p = PriceProposals[PriceProposals.length - 1];
        return (p.description, p.value, p.votesUp, p.votesDown);
    }

    function votingEndsAt() public view returns (uint256) {
        return votingDeadline;
    }

    function proposalExpiresAt() public view returns (uint256) {
        return deadline;
    }

    function proposePrice(string memory _desc, string memory _price) external {
        uint256 id = PriceProposals.length;
        if (id > 0) {
            if (!PriceProposals[id - 1].finalized) {
                if (deadline > block.number) {
                    revert ProposalIsStillActive();
                }
            }
        }
        
        PriceProposal memory p = PriceProposal(_desc, _price, 
            0, 0, false);

        votingDeadline = block.number + PROPOSAL_VOTING_BLOCKS; 
        deadline = block.number + PROPOSAL_BLOCKS;

        PriceProposals.push(p);
        
        emit ProposalCreated(id, _desc, msg.sender);
    }

    function voteUp() external {
        if (!ensureEligible()) {
            revert NotEligibleToVote();
        }

        uint256 _id = PriceProposals.length - 1;
        PriceProposal storage p = ensureProposal(_id);

        if (block.number >= votingDeadline) {
            revert VotingDeactivated();
        }

        int8 value = votes[_id][msg.sender];

        if (value == 1 || value == -1) {
            revert AlreadyVoted();
        }

        p.votesUp++;
        votes[_id][msg.sender] = 1;
        emit VotedUp(msg.sender, _id);
    }

    function voteDown() external {
        if (!ensureEligible()) {
            revert NotEligibleToVote();
        }
        
        uint256 _id = PriceProposals.length - 1;
        PriceProposal storage p = ensureProposal(_id);

        if (block.number >= votingDeadline) {
            revert VotingDeactivated();
        }
        
        int8 value = votes[_id][msg.sender];

        if (value == 1 || value == -1) {
            revert AlreadyVoted();
        }

        p.votesDown++;
        votes[_id][msg.sender] = -1;
        emit VotedDown(msg.sender, _id);
    }

    function finalizeProposal() external {
        uint256 _id = PriceProposals.length - 1;
        PriceProposal storage p = ensureProposal(_id);
        
        if (votingDeadline > block.number) {
            revert ProposalIsStillActive();
        }

        if (block.number >= deadline) {
            revert ProposalHasExpired();
        }

        if (p.finalized) {
            return;
        }

        if (p.votesUp > p.votesDown) {
            emit PriceUpdated(price, p.value);
            price = p.value;

            emit ProposalFinalized(_id, true);
            
        } else {
            emit ProposalFinalized(_id, false);
        }

        p.finalized = true;
    }

    function ensureEligible() private returns(bool) {
        if (block.number < tickets[msg.sender]) {
            return true;
        }
        
        for (uint i = 0; i < NFTCollections.length; i++) {
            address addr = NFTCollections[i];
            IERC721Proxy collection = IERC721Proxy(addr);

            if (collection.balanceOf(msg.sender) > 0) {
                tickets[msg.sender] = block.number + VERIFICATION_TICKET_BLOCKS;
                return true;
            }
        }
        
        return false;
    }

    function ensureProposal(uint256 _id) private view returns(PriceProposal storage) {
        if (_id >= PriceProposals.length) {
            revert ProposalDoesNotExist();
        }

        return PriceProposals[_id];
    }

    /// @notice A new proposal was created
    /// @dev Notifies that a new proposal was created
    /// @param id Id of the proposal
    /// @param description Description of the proposal
    /// @param proposer Address of the proposer
    event ProposalCreated(uint256 id, string description, address proposer);

    /// @notice A proposal has been voted up
    /// @dev Notifies that a proposal has been voted up
    /// @param voter Address of the voter
    /// @param proposalId Id of the proposal
    event VotedUp(address voter, uint256 proposalId);

    /// @notice A proposal has been voted down
    /// @dev Notifies that a proposal has been voted down
    /// @param voter Address of the voter
    /// @param proposalId Id of the proposal
    event VotedDown(address voter, uint256 proposalId);

    /// @notice Voting result of the Proposal
    /// @dev Notifies that a proposal has been finalized
    /// @param id Id of the proposal
    /// @param passed Result of the voting on proposal, passed defines that the proposal is accepted by the voters
    event ProposalFinalized(uint256 id, bool passed);

    /// @notice The price has been updated
    /// @dev Notifies that the price has been updated
    /// @param oldPrice The previous price that was replaced
    /// @param newPrice The new price replacing the previous price
    event PriceUpdated(string oldPrice, string newPrice);
}

contracts/DexhuneRoot.sol.content:
// SPDX-License-Identifier: BSD-3-Clause
/// @title Dexhune Owner and Management Logic
/*
*    ........................................................
*    .%%%%%...%%%%%%..%%..%%..%%..%%..%%..%%..%%..%%..%%%%%%.
*    .%%..%%..%%.......%%%%...%%..%%..%%..%%..%%%.%%..%%.....
*    .%%..%%..%%%%......%%....%%%%%%..%%..%%..%%.%%%..%%%%...
*    .%%..%%..%%.......%%%%...%%..%%..%%..%%..%%..%%..%%.....
*    .%%%%%...%%%%%%..%%..%%..%%..%%...%%%%...%%..%%..%%%%%%.
*    ........................................................
*/

pragma solidity >=0.4.22 <0.9.0;
import "./DexhuneBase.sol";

contract DexhuneConfig {
    //  30 seconds or 15 blocks, but in the testnet version we'll do 5 minutes
    uint256 internal constant MAXIMUM_VOTES_PER_PROPOSAL = 1000;
    uint256 internal constant BLOCKS_PER_SECOND = 2;

    bool public transferCooldown = true;
    uint public cooldownTimeout = BLOCKS_PER_SECOND * 60;
}

abstract contract DexhuneRoot is DexhuneConfig, DexhuneBase {
    address public owner;
    PriceProposal[] public PriceProposals;
    address[] public NFTCollections;

    constructor() {
        owner = msg.sender;
        // PriceProposals = new PriceProposal[](0);
        NFTCollections = new address[](0);
    }
    
    function ensureOwnership() private view {
        require(msg.sender == owner, "This method can only be called by the owner of this smart contract");
    }

    function transferOwnership(address _address) public {
        ensureOwnership();

        address oldAddress = owner;
        owner = _address;
        emit transferredOwnership(oldAddress, owner);
    }

    function addNFTCollection(address _contractAddress) public {
        ensureOwnership();
        require(_contractAddress != address(0), "An NFT collection cannot have an empty address");

        uint index = NFTCollections.length;
        NFTCollections.push(_contractAddress);
        emit addedNFTCollection(index, _contractAddress);
    }

    
    function removeNFTCollection(uint256 _index) public {
        ensureOwnership();
        
        require(_index >= 0 && _index < NFTCollections.length, "The requested NFT collection does not exist");

        address addr = NFTCollections[_index];
        
        // https://ethereum.stackexchange.com/a/59234
        NFTCollections[_index] = NFTCollections[NFTCollections.length - 1];
        NFTCollections.pop();
        
        emit removedNFTCollection(_index, addr);
    }

    function setTransferTimeout(bool _enabled) public {
        ensureOwnership();
        transferCooldown = _enabled;
    }

    function setCooldownTimeout(uint _timeout) public {
        ensureOwnership();

        cooldownTimeout = _timeout;
    }


    /// @notice Ownership of Dexhune has been transferred
    /// @dev Transfers ownership of the contract to another address
    /// @param from Address of the previous owner
    /// @param to Address of the new owner
    event transferredOwnership(address from, address to);

    /// @notice An NFT collection has been added
    /// @dev Adds an NFT collection
    /// @param id Id of the collection
    event addedNFTCollection(uint256 id, address collectionAddress);

    /// @notice An NFT collection has been removed
    /// @dev Removes an NFT collection
    /// @param id Id of the collection
    event removedNFTCollection(uint256 id, address collectionAddress);
}

contracts/DexhuneTokenRoot.sol.content:
// SPDX-License-Identifier: BSD-3-Clause
/// @title Dexhune ERC20 Root Implementation
// Sources: 
// https://github.com/OpenZeppelin/openzeppelin-contracts/blob/master/contracts/access/Ownable.sol
/*
*    ........................................................
*    .%%%%%...%%%%%%..%%..%%..%%..%%..%%..%%..%%..%%..%%%%%%.
*    .%%..%%..%%.......%%%%...%%..%%..%%..%%..%%%.%%..%%.....
*    .%%..%%..%%%%......%%....%%%%%%..%%..%%..%%.%%%..%%%%...
*    .%%..%%..%%.......%%%%...%%..%%..%%..%%..%%..%%..%%.....
*    .%%%%%...%%%%%%..%%..%%..%%..%%...%%%%...%%..%%..%%%%%%.
*    ........................................................
*/

import "./libraries/ABDKMath64x64.sol";

contract DexhuneTokenRoot  {
    address private _owner;

    address private _exchangeAddress;
    address private _daoAddress;
    uint256 private _totalMints;

    address[] private _holders;
    mapping(address => int128) private balances;

    int128 _supply = 0;
    int16 _mintCount = 0;

    uint256 _nextMintTime = 0;
    uint256 _nextExchangeMintTime = 0;
    uint256 _nextDaoMintTime = 0;

    uint32 private constant MINT_INTERVAL = 4 days;
    uint32 private constant EXCHANGE_MINT_INTERVAL = 1 days;
    uint32 private constant DAO_MINT_INTERVAL = 1 days;

    int16 private constant MINT_LIMIT = 3650;
    
    /// @dev Mint value to add to supply divided by ten thousand. Default value is 12, indicating 0.12% [0.0012 * 10000]
    int8 private constant MINT_VALUE_PER_TEN_THOUSAND = 12;

    int32 private constant INITIAL_MINT_VALUE = 10_000_000;
    int32 private constant EXCHANGE_MINT_VALUE = 1_400_000;
    int32 private constant DAO_MINT_VALUE = 5760;
    

    error UnauthorizedAccount(address account);

    
    error MintedTooEarly(uint256 timeRemaining);
    error MintLimitReached();
    error InvalidBalance(address addr, int128 balance);

    
    constructor() {
        _owner = msg.sender;
    }

    modifier ownerOnly() {
        _ensureOwnership();
        _;
    }

    function _ensureOwnership() private view {
        if (msg.sender != _owner) {
            revert UnauthorizedAccount(msg.sender);
        }
    }

    function setDaoAddress(address addr) external ownerOnly {
        _daoAddress = addr;
    }

    function setExchangeAddress(address addr) external ownerOnly {
        _exchangeAddress = addr;
        
    }

    function mint() external {
        if (_mintCount >= MINT_LIMIT) {
            revert MintLimitReached();
        }

        if (block.timestamp < _nextMintTime) {
            revert MintedTooEarly(block.timestamp - _nextMintTime);
        }

        _nextMintTime = block.timestamp + MINT_INTERVAL;

        int128 supply = _supply;
        int128 distribution = _thperc(supply, MINT_VALUE_PER_TEN_THOUSAND);
        
        _distribute(distribution);

        _supply += distribution;
    }

    function mintToExchange() external {
        if (block.timestamp < _nextExchangeMintTime) {
            revert MintedTooEarly(block.timestamp - _nextExchangeMintTime);
        }

        _nextExchangeMintTime = block.timestamp + EXCHANGE_MINT_INTERVAL;

        int128 balance = balances[_exchangeAddress];
        balance += EXCHANGE_MINT_VALUE;

        _setBalance(_exchangeAddress, balance); 
    }

    function mintToDao() external {
        if (block.timestamp < _nextDaoMintTime) {
            revert MintedTooEarly(block.timestamp - _nextDaoMintTime);
        }

        _nextDaoMintTime = block.timestamp + DAO_MINT_INTERVAL;

        int128 balance = balances[_daoAddress];
        balance += DAO_MINT_VALUE;

        _setBalance(_daoAddress, balance);
    }

    function _getBalance(address addr) internal view returns(int128) {
        int128 balance = balances[addr];

        if (balance < 0) {
            balance = 0;
        }

        return balance;
    }

    function _getFullBalance(address addr) internal view returns(uint256) {
        int128 balance = _getBalance(addr);
        return _toUInt(balance);
    }

    function _setBalance(address addr, int128 balance) private {
        if (balance < 0) {
            revert InvalidBalance(addr, balance);
        }

        if (balance == 0) {
            balance = -1;
        }

        int128 oldBalance = balances[addr];

        // User does not have a balance, no further changes required
        if (oldBalance == 0 && balance == -1) {
            return;
        }

        // Balance is zero, user does not exist
        if (oldBalance == 0) {
            _holders.push(addr);
        }

        balances[addr] = balance;
    }

    function _setBalance(address addr, uint256 balance) internal {
        _setBalance(addr, ABDKMath64x64.fromUInt(balance));
    }

    function _distribute(int128 funds) private {
        address holder;
        int128 balance;

        int128 div;
        int128 cut;

        for (uint i = 0; i < _holders.length; i++) {
            holder = _holders[i];

            
            balance = balances[holder];
            
            div = ABDKMath64x64.div(balance, _supply);
            cut = ABDKMath64x64.mul(div, funds);

            balance += cut;

            balances[holder] = balance;
        }
    }

    function _thperc(int128 value, int8 percentage) private pure returns(int128) {
        int128 res = ABDKMath64x64.mul(value, percentage);
        res = ABDKMath64x64.div(res, 10000);

        return res;
    }

    function _toUInt(int128 value) internal pure returns(uint256) {
        return ABDKMath64x64.toUInt(value);
    }
}

